import React from 'react';
import { Box, Typography, Paper } from '@mui/material';
import { Prism as SyntaxHighlighter } from 'react-syntax-highlighter';
import { oneDark } from 'react-syntax-highlighter/dist/esm/styles/prism';

const Notebook = ({ steps }) => {
  if (!steps || steps.length === 0) return null;

  return (
    <Box sx={{ mt: 4 }}>
      <Typography variant="h5" gutterBottom>ðŸ““ Notebook</Typography>
      {steps.map((step, index) => (
        <Paper key={index} elevation={3} sx={{ p: 2, mb: 3 }}>
          <Typography variant="subtitle1" sx={{ fontWeight: 'bold' }}>
            âž¤ Prompt: {step.prompt}
          </Typography>

          <Typography variant="body2" sx={{ mt: 1, mb: 1 }}>
            <b>Generated Code:</b>
          </Typography>
          <SyntaxHighlighter language="python" style={oneDark}>
            {step.code}
          </SyntaxHighlighter>

          {step.output?.type === 'text' && (
            <Box sx={{ mt: 2 }}>
              <Typography variant="body2"><b>Output:</b></Typography>
              <Paper sx={{ p: 1, backgroundColor: '#f4f4f4', whiteSpace: 'pre-wrap' }}>
                {step.output.content}
              </Paper>
            </Box>
          )}

          {step.output?.type === 'image' && (
            <Box sx={{ mt: 2 }}>
              <Typography variant="body2"><b>Output (Plot):</b></Typography>
              <img
                src={`http://localhost:5000/sessions/${step.output.sessionId}/${step.output.filename}`}
                alt={`Step ${index + 1} Output`}
                style={{ width: '100%', marginTop: 8 }}
              />
            </Box>
          )}
        </Paper>
      ))}
    </Box>
  );
};

export default Notebook;
